import React from 'react';
import './navbarStyle.scss';

function Navbar() {
    return (
        <div className="navWrapper">
        <nav>
            <ul>
                <li>
                    Register
                </li>
                <li>
                    Login
                </li>
            </ul>
        </nav>
        </div>
    );
}

export default Navbar;
